import * as types from './../constants/ActionType';


export const actChangeNotify = (content) => {
	return {
		type : types.CHANGE_NOTIFY,
		content
	}
}
export const actSubmit = (number) => {
	return {
		type : types.BUY_PRODUCT,
		number
	}
}
